import React from 'react'

class Floor extends React.Component {

    render() {
        return (
            <form id='floor'>
                {this.props.allFloors.map(x => 
                    x === this.props.floor ? 
                    <label htmlFor={x} style={{color: 'red'}}>{x}</label> : <label htmlFor={x}>{x}</label>)}
                <ul>
                    {this.props.allFloors.map(x => (
                    <li key={x}>
                        <input 
                                type='radio' 
                                name='floor' 
                                value={x}
                                id={x} 
                                checked={x === this.props.floor}
                                onChange={this.props.handleChangeFloor}
                            />
                        <label htmlFor={x}>{x}</label>
                    </li>))}
                </ul>
            </form>)
    }
}

export default Floor
